import { Box, Checkbox, Typography } from '@mui/material';
import React from 'react';

const Email = () => {
  return (
    <Box>
      <Checkbox />
      <Star />
      <StarBorder />
      <Typography></Typography>
    </Box>
  );
};

export default Email;
